                className="d-inline-block align-top"
              />
              </Card.Title>
          <Card.Subtitle className="mb-2 text-muted">Foro inform√°tico</Card.Subtitle>
          <Card.Text>
            Fundado a principios de 2018.
          </Card.Text>
          <Card.Link href="https://www.nodo313.net">Acceso al foro</Card.Link>
          <Card.Link href="https://www.nodo313.net/index.php?members/cbrn.2/">Mi perfil</Card.Link>
        </Card.Body>
      </Card>

      </Row>
    </Container>
  }
}

export default Home;
